title:
Gezicht in Winkel vanuit het zuidwesten, ca. 1730; links het raadhuis van Winkel met op daklijst leeuwen met wapenschilden. In het midden een stenen brug met rondboog, rechts op
          de achtergrond de toren van de kerk, geheel rechts op het middenplan een herberg 1 topogr. tek.: pen en penseel in grijs; kader: pen in zwart, penseel in grijs. l.o.: C: pronk del ad viv;
          afb.: 120 x 180 mm.blad: 147 x 204 mm.
